import { Link } from "react-router-dom";

function App() {
  return (
    <main className="p-10 m-auto">
      <header className="flex justify-between">
        <Link to={"/"} className="font-bold">
          Flowrite
        </Link>
        <nav className="flex gap-5">
          <Link to={"/"}>Login</Link>
          <Link to={"/"}>Register</Link>
        </nav>
      </header>
      <div>
        <img src="https://images.pexels.com/photos/18388164/pexels-photo-18388164.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="" />
        <h2>Blogs for mountain lovers only</h2>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. In ullam nemo vitae vel tempora consequatur, esse eligendi et adipisci, sunt, excepturi rerum. Corrupti neque saepe nulla quasi distinctio, ipsum adipisci repudiandae error nobis fuga commodi ex nisi ab eaque! Obcaecati.</p>
      </div>
    </main>
  );
}

export default App;
